If(wr_ptr._eq(rd_ptr),
    If(looped,
        dataIn_wait(0x1),
        dataOut_wait(0x0),
    ).Else(
        dataOut_wait(0x1),
        dataIn_wait(0x0),
    ),
).Else(
    dataIn_wait(0x0),
    dataOut_wait(0x0),
)

If(fifo_read,
    If(rd_ptr._eq(15 - 1.auto_cast(Bits(4, signed=False))),
        rd_ptr_next(0x0),
    ).Else(
        rd_ptr_next(rd_ptr + 1),
    ),
).Else(
    rd_ptr_next(rd_ptr),
)

If(fifo_write,
    If(wr_ptr._eq(15 - 1.auto_cast(Bits(4, signed=False))),
        wr_ptr_next(0x0),
    ).Else(
        wr_ptr_next(wr_ptr + 1),
    ),
).Else(
    wr_ptr_next(wr_ptr),
)

If((dataIn_en._eq(0x1)) & (wr_ptr._eq(15 - 1.auto_cast(Bits(4, signed=False)))),
    looped_next(0x1),
).Elif((dataOut_en._eq(0x1)) & (rd_ptr._eq(15 - 1.auto_cast(Bits(4, signed=False)))),
    looped_next(0x0),
).Else(
    looped_next(looped),
)
